	return (
		<>
			<Row justify="center">
				<Carousel
					dotPosition="left"
					ref={carouselRef}
					dots="false"
					effect="scrollx"
					style={{ marginTop: "100px" }}
				>
					{arr.map((c) => {
						console.log(c);
						return <Question index={c.id} key={c.id} />;
					})}
				</Carousel>
			</Row>
		</>
	);
};

export default Dg;
